import React from "react";
import PropTypes from "prop-types";
import "./profile.css";

const UserProfile = ({
  userName,
  userEmail,
  userImageSrc,
  userBio,
  userLocation,
}) => {
  return (
    <div className="user-profile-container">
      <div className="user-profile-card">
        <div className="user-profile-header">
          <img
            src={userImageSrc}
            alt={`${userName}'s profile`}
            className="user-profile-image"
          />
          <h2 className="user-profile-name">{userName}</h2>
        </div>
        <div className="user-profile-info">
          <p className="user-profile-email">Email: {userEmail}</p>
          <p className="user-profile-location">Location: {userLocation}</p>
          <p className="user-profile-bio">{userBio}</p>
        </div>
        <div className="user-profile-actions">
          <button className="user-profile-edit-btn thq-button-outline">
            Edit Profile
          </button>
          <button className="user-profile-signout-btn thq-button-filled">
            Sign Out
          </button>
        </div>
      </div>
    </div>
  );
};

UserProfile.defaultProps = {
  userName: "John Doe",
  userEmail: "johndoe@example.com",
  userImageSrc: "https://via.placeholder.com/150",
  userBio: "This is a short bio about the user.",
  userLocation: "New York, USA",
};

UserProfile.propTypes = {
  userName: PropTypes.string,
  userEmail: PropTypes.string,
  userImageSrc: PropTypes.string,
  userBio: PropTypes.string,
  userLocation: PropTypes.string,
};

export default UserProfile;
